import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo">LOGO</div>
      <nav>
        <ul>
          <li>Home</li>
          <li>Catalog</li>
          <li>Cart</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
